import React from "react";
import { AuthenticationService } from "../../../jwt/_services";
// import * as data from "./Data";

/*--------------------------------------------------------------------------------*/
/* Import images which are need for the HEADER                                    */
/*--------------------------------------------------------------------------------*/
// import logodarkicon from "../../../assets/images/logo-icon.png";
// import logolighticon from "../../../assets/images/logo-light-icon.png";
// import logodarktext from "../../../assets/images/logo-text.png";
// import logolighttext from "../../../assets/images/logo-light-text.png";
// import profilephoto from "../../../assets/images/users/5.jpg";

// import logoOnly from "../../../assets/images/project-logos/logo_40x40.png";
// import logoText from "../../../assets/images/project-logos/logo_text_108x19.png";

export default () => {

	const userName = AuthenticationService.currentUserValue.first_name + ' ' + AuthenticationService.currentUserValue.last_name;
	const email = AuthenticationService.currentUserValue.email_address;


	return (
		<header>
			<main className="cont">
				<div class="logo">
					<img src="./images/logo.png" alt="logo" />
				</div>
				<ul>
					<li>
						<h3>Galactica</h3>
						<img class="icon-img" src="./images/down-arrow.png" alt="down-arrow" />
						<ul class="dropList">
							<li>Action</li>
							<li>Another Action</li>
							<li>Action Again</li>
						</ul>
					</li>
					<li>
						<a href="#">
							<img class="icon-img" src="./images/projectBoard icon.png" alt="projectBoard" />
							<span>Project Board</span>
						</a>
					</li>
					<li class="mr-a">
						<a href="#">
							<img class="icon-img" src="./images/brands icon.png" alt="brands" />
							<span>Brands</span>
						</a>
					</li>
					<li><button>Outsourcer plan</button></li>
					<li><img class="icon-img-bel" src="./images/bell.png" alt="bell icon" /></li>
					<li>
						<img src="./images/profile image.png" alt="profile" />
						<strong>Billy Madison</strong>
						<img src="./images/down-arrow.png" alt="down-arrow" />
						<ul class="dropList">
							<li>Action</li>
							<li>Another Action</li>
							<li>Action Again</li>
						</ul>
					</li>
				</ul>
				<div class="burger">
					<div class="line l1"></div>
					<div class="line l2"></div>
					<div class="line l3"></div>
				</div>
			</main>
		</header>
	);
};
